config = {'displaylogo': False, 'modeBarButtonsToRemove': ["zoomIn", "zoomOut", "autoScale","resetScale"],'modeBarButtonsToAdd':['drawline','drawopenpath', 'drawrect','eraseshape'],}

def picture(l):
  df2=get_g("BTC","/v1/metrics/market/price_usd_close","24h","NATIVE")
  two,symbol,addresses,intervel,currency=l[0],l[1],l[2],l[3],l[4]
  fig=go.Figure()
  with st.expander("Edit"):
    slider=st.slider("Moving average",min_value=1,max_value=100,step=1,key=two)
    numberofData=st.slider("numberofData",min_value=500,max_value=4000,step=1,key=two)
  df=get_g(symbol, addresses, intervel, currency).tail(numberofData)
  df3=df2.tail(len(df))
  listy=df.columns[1:].tolist()
  if len(listy)==1:
    fig.add_trace(go.Scatter(
      x=df["t"],
      y=df["v"].rolling(slider).mean(),
      name=two,
      yaxis="y1"
    ))
  else:
    for i in listy:
      fig.add_trace(go.Scatter(
        x=df["t"],
        y=df[i].rolling(slider).mean(),
        line=dict(width=0.5),
        name=i,
        stackgroup='one',
        yaxis="y1"
      ))
  fig.add_trace(go.Scatter(
      x=df3["t"],
      y=df3["v"],
      name="Price",
      line=dict(color='rgba(120, 120, 120,0.3)'
                              ),
      yaxis="y2"
    ))
  fig.update_layout(
    yaxis=dict(
        titlefont=dict(
            color="#1f77b4"
        ),
        tickfont=dict(
            color="#1f77b4"
        )
    ),
    yaxis2=dict(
        titlefont=dict(
            color="#d62728"
        ),
        tickfont=dict(
            color="#d62728"
        ),
        anchor="x",
        overlaying="y",
        side="right"
    ),
    legend=dict(
    orientation="h",
    yanchor="top",
    y=-0.05,
    xanchor="left",
    x=0
)
  )
  fig.update_layout(
      title_text=two
      )
  st.plotly_chart(fig, use_container_width=True,config=config)

@st.experimental_memo(ttl=60*60*24)
def messariP(x):
  url="https://data.messari.io/api/v1/assets/%s/metrics/price/time-series"%(x)
  header={ "x-messari-api-key": "77fd912b-7c49-449f-a808-d3755b9bb69a"}
  r=requests.get(url,headers=header,params = {"interval":"1d","columns":"close"})
  df=pd.DataFrame(r.json()["data"]["values"])
  return df

lay1=["SOL","BNB","ADA","MATIC","AVAX"]
